  BrowserRouter,
  Routes,
  Route,
  Navigate,
  Router,
} from "react-router-dom";

import App from "./App";

const root = ReactDOM.createRoot(document.getElementById("root"));

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
